Blog.create!([
  {title: "How to Make Shrubs at Home", content: "<p><a data-flickr-embed=\"true\" href=\"https://www.flickr.com/photos/58189808@N03/10375024563/in/album-72157636742526245/\" title=\"Making Apple Shrub\"><img alt=\"Making Apple Shrub\" height=\"800\" src=\"https://c4.staticflickr.com/6/5477/10375024563_de33fb8597_c.jpg\" width=\"600\" /></a><script async src=\"//embedr.flickr.com/assets/client-code.js\" charset=\"utf-8\"></script></p>\r\n\r\n<p>You know how it goes. You&#39;ve got a fun-sounding cocktail recipe all picked out and ready to try, but then you see it. &quot;Apple Shrub&quot; is listed as an ingredient! What is a shrub? Where do they come from?</p>\r\n\r\n<p>Well, an apple shrub is not a very small apple tree! Shrubs in this context are actually drinking vinegars, and are very easy (and fun) to make at home!</p>\r\n\r\n<p>In general, all you need to do is mix equal parts:</p>\r\n\r\n<ul>\r\n\t<li>Fruit</li>\r\n\t<li>Vinegar</li>\r\n\t<li>Sugar</li>\r\n</ul>\r\n\r\n<p>And let it macerate for about a week. Then, filter your shrub, and you are ready to go! Once you have the basics down, feel free to play around with the proportions or start adding things like spices. I&#39;ve even heard of Ritual Coffee making a coffee shrub, where they use coffee beans instead of fruit and add bitters!</p>\r\n\r\n<p>Shrubs add incredible depth and complexity to drinks, so pretty soon you will be mixing cocktails like the pros at your favorite craft cocktail bar!</p>\r\n", user_id: 1, draft: false},
  {title: "Milk Liqueur?!?", content: "<p>You read that right: milk liqueuer!</p>\r\n\r\n<p>There is a way to make a milk liqueur that you can add to acidic /fruity drinks, and it won&rsquo;t curdle! Sure, this is mostly because it has already curdled, but hey! You still get a surprising amount of milky delicious flavour from it. So much so, that I am willing to bet that letting the milk infuse the alcohol for a long period of time allows many more of the alcohol-soluble flavors to leave the milk and go into the alcohol than you would get if you simply added whey to alcohol as a shortcut. You even get that miraculous milky velvety texture.</p>\r\n\r\n<p>It is easy enough to make your own, you simply mix equal parts milk, sugar, and vodka together and let it sit for two weeks. Hopefully by then, the milk proteins will have denatured and separated out from the liquids and the alcohol. If this has happened, you should then filter out the curdled solids with a cloth or coffee filter, leaving a rich golden liqueur for sipping or mixing (discard the solids).</p>\r\n\r\n<p><a data-flickr-embed=\"true\" href=\"https://www.flickr.com/photos/58189808@N03/13686553893/\" title=\"Milk Liqueur In Progress\"><img alt=\"Milk Liqueur In Progress\" height=\"800\" src=\"https://c6.staticflickr.com/4/3829/13686553893_97edca76f0_c.jpg\" width=\"600\" /></a><script async src=\"//embedr.flickr.com/assets/client-code.js\" charset=\"utf-8\"></script></p>\r\n\r\n<p>I was lucky enough to get some separation doing it this way, but apparently this doesn&rsquo;t always work. Some people suggest putting a lemon, orange, or other citrus fruit into the mix. The acid in the fruit will help denature the proteins and speed up the clumping process. However, I just wanted a pure milky flavour, without any overpowering citrus in the mix. Especially if I want to mix this into cocktails, I don&rsquo;t want the extra complexity of orange in there. Don&rsquo;t get me wrong, I can imagine that this could taste like a delicious Creamsicle. Just not what I was going for. Apparently, some people also put chocolate into the mix. Again, sounds delicious, but not the pure essence of milk that I want.</p>\r\n\r\n<p>So is there some other way to make sure your milk will curdle correctly, every time? I guess you could use vinegar, but that would be even grosser than lemon. And then it hit me&hellip; why not use cream of tartar?</p>\r\n\r\n<p>All you need is a more acidic environment to denature the milk proteins, and cream of tartar is a relatively flavourless acid &ndash; one that is often added to pastries which need acidity for the chemistry to work, without adding any offending flavors.</p>\r\n\r\n<p>Seemed like it should do the trick, so to the second batch (which was about 2 cups total) I added 1.5 teaspoons of cream of tartar before sealing it up and mixing. This worked perfectly! By the second day I already saw loads of separation, and the alcohol/water phase continued to get richer and more golden as time went on. It was absolutely a better result than without the acid!</p>\r\n\r\n<p><a data-flickr-embed=\"true\" href=\"https://www.flickr.com/photos/58189808@N03/13901946171/\" title=\"Milk Liqueur Can Look Groady Whilst in Progress\"><img alt=\"Milk Liqueur Can Look Groady Whilst in Progress\" height=\"800\" src=\"https://c4.staticflickr.com/3/2914/13901946171_1252b4812c_c.jpg\" width=\"600\" /></a><script async src=\"//embedr.flickr.com/assets/client-code.js\" charset=\"utf-8\"></script></p>\r\n\r\n<p>Now I can make drinks with shrubs (and other acidic flavours) in addition to milk liqueur, and not worry about it curdling and becoming gross.</p>\r\n\r\n<p>I hadn&rsquo;t considered this before making milk liqueur, but this could even the be the first time you get to taste milk mixed with acidic ingredients like lemon or shrub, because the 2 week infusion process brings all the milk flavours into the liqueur while also removing the curdling elements. So essentially this liqueur opens up all new possibilities. Delicious possibilities.</p>\r\n\r\n<p>Like one of my favourite drinks, the Forget About Me:</p>\r\n\r\n<p><a data-flickr-embed=\"true\" href=\"https://www.flickr.com/photos/58189808@N03/13686559123/\" title=\"The Forget About Me\"><img alt=\"The Forget About Me\" height=\"800\" src=\"https://c4.staticflickr.com/4/3806/13686559123_c8b7f87c3d_c.jpg\" width=\"600\" /></a><script async src=\"//embedr.flickr.com/assets/client-code.js\" charset=\"utf-8\"></script></p>\r\n\r\n<p>Whiskey, cherry shrub, milk liqueur, and a cherry. It is surprisingly milky and delicious. How often can you taste these flavours together? Not very, since the milk normally curdles! This is a breakthrough.</p>\r\n", user_id: 1, draft: nil},
  {title: "Test", content: "<p><a href=\"/uploads/ckeditor/pictures/1/content_King_Richard_and_Tad_Cooper.jpg\"><img alt=\"\" src=\"/uploads/ckeditor/pictures/1/content_King_Richard_and_Tad_Cooper.jpg\" style=\"width: 800px; height: 450px;\" /></a></p>\r\n\r\n<p>This is a test of the upload functionality.</p>\r\n", user_id: 1, draft: nil}
])
